import React, {useState} from 'react';
import * as cal from './DanhSachGame'
import contact from './contacts'


function createCard(contact) {
    return (
      <cal.default 
      id = {contact.id}
      image = {contact.image}
      name = {contact.name}
      ngayph = {contact.ngayph}
      theloai = {contact.theloai}
      solike = {contact.solike}
      sodislike = {contact.sodislike}
      socmt = {contact.socmt}
       />
    )
}
  function Taothe() {
    var likes = contact.solike;
    likes.sort(function(a, b){return a - b});
    return (
        <div className = "cacgame">
        {contact.map(createCard)}
        </div>
    )
  }
  export default Taothe;
